import React from 'react';
import ConsoleOpenActivList from './ConsoleOpenActivList';
import ButtonSmall from '../../UserInterface/Buttons/Button/ButtonSmall';

import Input from '../../UserInterface/Input/Input';


function FooterTable(props) {


    return (

        <div className={props.classname}>



            <ConsoleOpenActivList
                counterPages={props.counterPages}
                activArrNumberPages={props.activArrNumberPages}
                numberActivList={props.numberActivList}
                onclickOpenPagesTable={props.onclickOpenPagesTable}
                onclickChangeButtonConsole={props.onclickChangeButtonConsole}
            />
               
               
            <div>
                {
                    props.flagCountRow ?
                        <Input
                            id="inputCountRow"
                            type="number"
                            label="Строк на странице : "
                            onchange={props.onchange}
                            value={props.CountRow}
                            tabindex="-1"
                        />
                        : <div> Строк на странице : <span> {props.CountRow} </span> из {props.lenght}</div>
                }
            </div>
            {
                props.flagCountRow ?
                    <ButtonSmall
                        className={props.classnameButtonConsoleCountRow}
                        onclick={props.onclickInputSave}
                        tabindex='-1'
                        icon="fa fa-floppy-o"
                    />
                    :<ButtonSmall
                        className={props.classnameButtonConsoleCountRow}
                        onclick={props.onclickInputOpen}
                        tabindex='-1'
                        icon="fa fa-pencil"
                    />
             }

        </div>

    )
}

export default FooterTable
